// @updateURL https://update.greasyfork.org/scripts/502167/%E7%99%BE%E5%BA%A6%E7%9F%A5%E9%81%93%E6%98%BE%E7%A4%BA%E4%BC%98%E5%8C%96.meta.js
// ==/UserScript==
setTimeout(function (){
    var badEvaluate = document.getElementsByClassName('evaluate-bad');
    for (var i = 0; i < badEvaluate.length; i++) {
        var child = badEvaluate[i];
        var count = child.getAttribute('data-evaluate');
        child.innerHTML += '<b class="evaluate-num">'+ count +'</b>';
    }
}, 1000);